function Card(props){
    return(
  <>
    <div className='Carts'>
    <div className='card'>
    <Images  imgsrc={props.imgsrc}  alt="img" />
      {/* <img  className="img1" src={props.imgsrc}  alt='img'></img> */}
      <div className='detials'> 
      <span className='heading'>{props.heading}</span>
      <h3 className='para'>{props.para}</h3>
       <a href='https://www.netflix.com/pk/' target='blank'>
       <button>Watch now</button>
       </a>
      </div>
    </div>
   </div>
  </>)
  }

export default Card;
